- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Windows 10 Vibranium
- ONNX Runtime installed from (source or binary): source
- ONNX Runtime version: 0.5
- Python version: NA
- Visual Studio version (if applicable): 2017
- GCC/Compiler version (if compiling from source): NA
- CUDA/cuDNN version: NA
- GPU model and memory: NA

**To Reproduce**
Pass `axes` with [2,3] to MVN v9:

    {
      "op_type": "MeanVarianceNormalization",
      "version": 9,
      "axes": [2,3], // Only height, width (no normalization across batch dimension)
      "X": {"value": [ [[[1, 2], [3, 4]]], [[[1, 2], [3, 4]]] ]},
      "Y": {"value": [ [[[-1.34164, -0.447214], [0.447214, 1.34164]]], [[[-1.34164, -0.447214], [0.447214, 1.34164]]] ]},
      "T": "float32"
    }

**Expected behavior**
Mean reduction occurs along `axes` passed.

Until then, report an error:

    constexpr int64_t cross_channel_axes[] = { 0,1,2,3 };
    constexpr int64_t batch_spatial_axes[] = { 0,2,3 };

    if (std::equal(std::begin(axes), std::end(axes), std::begin(cross_channel_axes), std::end(cross_channel_axes)))
    {
        this->across_channels_ = true;

    }
    else if (std::equal(std::begin(axes), std::end(axes), std::begin(batch_spatial_axes), std::end(batch_spatial_axes)))
    {
        this->across_channels_ = false;
    }
    else
    {
        ORT_THROW("MeanVarianceNormalization axes parameter only supports NHW and NCHW reduction.");
    }


