void CreateSession(
  const char* model_path, const int device_id, OrtEnv* env,
  OrtSessionOptions* session_options, OrtSession** session)
{
  // To deploy on different device, need to set provider on cloned option
  // as you can remove a execution provider once it is appended
  OrtSessionOptions* context_options;
  CHECK_STATUS(OrtCloneSessionOptions(session_options, &context_options));
  std::unique_ptr<OrtSessionOptions, decltype(&OrtReleaseSessionOptions)>
      options_wrapper(context_options, OrtReleaseSessionOptions);

  // Use TensorRT / CUDA, device 0. CPU if -1
  if (device_id >= 0) {
    CHECK_STATUS(OrtSessionOptionsAppendExecutionProvider_Tensorrt(context_options, device_id));
    CHECK_STATUS(OrtSessionOptionsAppendExecutionProvider_CUDA(context_options, device_id));
    std::cout << "deploy on GPU " << device_id << std::endl;
  } else {
    std::cout << "deploy on CPU" << std::endl;
  }
  
  CHECK_STATUS(OrtCreateSession(env, model_path, context_options, session));
}

std::vector<TensorInfo> GetIOTensors(OrtSession* session, bool is_input, bool print_info = true)
{
  std::vector<TensorInfo> res;

  OrtAllocator* allocator;
  CHECK_STATUS(OrtGetAllocatorWithDefaultOptions(&allocator));

  // print number of model input nodes
  size_t num_nodes;
  if (is_input) {
    CHECK_STATUS(OrtSessionGetInputCount(session, &num_nodes));
  } else {
    CHECK_STATUS(OrtSessionGetOutputCount(session, &num_nodes));
  }

  // iterate over all input nodes
  for (size_t i = 0; i < num_nodes; i++) {
    OrtTypeInfo* typeinfo;
    if (is_input) {
      CHECK_STATUS(OrtSessionGetInputTypeInfo(session, i, &typeinfo));
    } else {
      CHECK_STATUS(OrtSessionGetOutputTypeInfo(session, i, &typeinfo));
    }
    std::unique_ptr<OrtTypeInfo, decltype(&OrtReleaseTypeInfo)>
      type_info_wrapper(typeinfo, OrtReleaseTypeInfo);
      
    const OrtTensorTypeAndShapeInfo* tensor_info;

    // node names
    char* tensor_name;
    if (is_input) {
      CHECK_STATUS(OrtSessionGetInputName(session, i, allocator, &tensor_name));
    } else {
      CHECK_STATUS(OrtSessionGetOutputName(session, i, allocator, &tensor_name));
    }
    
    // node types
    ONNXTensorElementDataType type;
    CHECK_STATUS(OrtCastTypeInfoToTensorInfo(typeinfo, &tensor_info));
    CHECK_STATUS(OrtGetTensorElementType(tensor_info, &type));

    // shapes/dims
    size_t num_dims;
    CHECK_STATUS(OrtGetDimensionsCount(tensor_info, &num_dims));
    std::vector<int64_t> dims(num_dims);
    CHECK_STATUS(OrtGetDimensions(tensor_info, (int64_t*)dims.data(), num_dims));

    res.emplace_back(tensor_name, type, dims);
  }

  if (print_info) {
    std::cout << "Number of tensors = " << num_nodes << std::endl;
    for (size_t idx = 0; idx < res.size(); idx++) {
      std::cout << "Tensor " << idx << ":" << std::endl
                << "    name: " << res[idx].name_ << std::endl
                << "    type: " << res[idx].type_ << std::endl
                << "    dims: " << DimsToString(res[idx].dims_) << std::endl
                << "    stuffed_dims: " << DimsToString(res[idx].stuffed_dims_)
                << std::endl;
    }
  }
  return res;
}

OrtValue*
CreateTensor(const TensorInfo& info)
{
  OrtAllocator* allocator;
  CHECK_STATUS(OrtGetAllocatorWithDefaultOptions(&allocator));

  OrtValue* res = nullptr;
  CHECK_STATUS(OrtCreateTensorAsOrtValue(
    allocator, info.stuffed_dims_.data(), info.stuffed_dims_.size(), info.type_, &res));
  return res;
}

OrtValue*
CreateTensor(const TensorInfo& info, std::vector<char>& data)
{
  OrtAllocator* allocator;
  CHECK_STATUS(OrtGetAllocatorWithDefaultOptions(&allocator));

  const OrtMemoryInfo* allocator_info;
  CHECK_STATUS(OrtAllocatorGetInfo(allocator, &allocator_info));
  OrtValue* res = nullptr;
  CHECK_STATUS(OrtCreateTensorWithDataAsOrtValue(
    allocator_info, data.data(), data.size(),
    info.stuffed_dims_.data(), info.stuffed_dims_.size(), info.type_, &res));
  return res;
}

